import React from 'react';
import {Link} from 'react-router-dom';

function Home() {
  return (
    <div>
        <div class="card" style="width:40%;">
            <div class="card-body">
                This is some text within a card body.
            </div>
        </div>
        <Link to='/schedule'>
            <button className="btn btn-danger"> Button</button>
        </Link>
    </div>
  );
}


export default Home;
